INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesID`, `categoryCode`, `description`, `userID`, `overviewID`, `imagesId`, `createdAt`, `updatedAt`) VALUES
('03c2c250-f85c-4e6e-8924-da2bcdc9cd87', 'Sang quán cà phê giá siêu tốt Mặt Tiền đường 7A Thành Thái, P14, Quận 10 (Đường 20m, đông khách)', '0', 'PMO6', 'Địa chỉ: 7A/9 Đường Thành Thái, Phường 14, Quận 10, Hồ Chí Minh', 'b1160280-e483-4451-8d6d-1d04f7c86a33', 'MBVP', '[\"Mình bận công việc riêng gia đình cho nên mình cần sang quan cafe đang kinh doanh rất tốt và đông khách đã hoạt động ổn định 3 năm nay tại khu trung tâm quận 10. Mặt bằng quán nằm ngay khu trung tâm ăn uống mua sắm mặt tiền đường 7A Thành Thái, khách ghé qua xem sẽ thấy rất hài lòng.\",\"Quán cafe này thiết kế theo tiêu chuẩn cao cấp, với không gian đẹp và vô cùng thoải mái. Thích hợp cho việc thư giãn sau chuỗi công việc mệt mỏi hoặc cùng tám với những người bạn của mình.\",\"Mọi thiết bị trong quán còn mới, được trang bị đẩy đủ không thiếu bất cứ 1 thứ gì. Có thể nói nếu khách sang xong vào là sẽ bắt đầu kinh doanh ngay, không cần sắm thêm hay sữa chữa gì khác nữa.\",\" Chỗ giữ xe thoải mái cũng là 1 ưu thế lớn cho quán, vì ít có quán nào tại khu vực này có thể có 1 chỗ giữ xe thoải mái cho khách như quán mình.\",\"Quán với diện tích ~100m2 ( 7m x 14m ).\",\"Gồm đầy đủ các thiết bị cao cấp :\",\" Máy Pos, Máy xay sinh tố công nghiệp, Máy xay cà phê, Máy pha cà phê đôi, Máy ép nước, Màn hình cảm ứng …\",\"Bàn ghế cao cấp và chất lượng được thiết kế riêng (15 bộ bàn và 54 ghế lớn)\",\"Quầy pha chế và toàn bộ dụng cụ pha chế cao cấp\",\"Máy lạnh, Hệ thống camera an ninh giám sát\",\"Dàn âm thanh trần, WC riêng sang và sạch sẽ\",\"Đồng hồ điện riêng biệt.\",\"...Nhiều vật dụng khác nữa.\",\"Giá sang quán cafe cũng toàn bộ thiết bị : 250 triệu ( không bao gồm phần tiền cọc 100 triệu với chủ nhà)\",\"Giá thuê mặt bằng kinh doanh : 23 triệu / 1 tháng, hợp đồng ký mới lâu dài với chủ nhà.\",\"Địa chỉ: 7A/9 Thành Thái, P.14, Quận 10 (Mặt tiền đường lớn rộng 20m 7A Thành Thái)\",\"Liên Hệ: 0937554570 (A.Hoàng).\"]', '25a186a6-f21e-4aea-86b8-20a666d2af1c', '4acb7376-511d-4574-8133-9cde98b217d6', '9cc5c655-0280-4f72-882c-07064a33384f', '2024-03-23 19:22:29', '2024-03-23 19:22:29'),
('04a1a7d7-df61-4751-8c89-a781fd99f54c', 'Căn hộ 1PN, đang trống, cho thuê full nội thất, có máy giặt riêng tại đường Lâm Văn Bền, Q.7', '2', 'NPA9', 'Địa chỉ: 20 Đường Lâm Văn Bền, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', '0e48e8e3-78ae-4c1d-a349-bbdd8b598e6e', 'CTCH', '[\"Căn hộ 1PN, đang trống, cho thuê full nội thất, có máy giặt riêng tại đường Lâm Văn Bền, Q.7\",\"Giá thuê chỉ 6.000.000\",\"Phòng lớn, thoáng mát, có bếp riêng, máy giặt sử dụng chung tại sân phơi \",\"Có thang máy, chỗ để xe miễn phí, rộng, khóa cổng vân tay\",\"- Thuận tiện di chuyển qua Q4, Q1\",\"Chi tiết liên hệ (zalo/call/imess) : 037.321.9099 Gặp Đức Thiên\"]', 'ee274488-909d-410d-a7ba-31885615ad24', 'a4c2fdb0-99f1-49c9-b4ee-5fa1b79c30ae', '2402c507-601a-412f-a9f5-92870d0e8201', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
