('348daa70-d1d1-464e-a910-7e571304a801', 'Phòng trọ chung cư Long Sơn mặt tiền Huỳnh Tấn Phát , Quận 7. An ninh- Thoáng mát.', '4', 'YHO3', 'Địa chỉ: 1349 Đường Huỳnh Tấn Phát, Phường Phú Thuận, Quận 7, Hồ Chí Minh', '6dad2e4c-62f4-4318-bf3f-925f6fecbca8', 'CTPT', '[\"Cần cho thuê\",\"Phòng riêng 1tr7 10m2 vách ngăn.\",\"Phòng 13-15m2 giá 2tr3-2tr4\",\"Phòng master 23m2 giá 3tr5 tolet riêng khép kín trong phòng .\",\"Có tủ lạnh, máy giặt , khu phơi sử dụng thoải mái ít người .\",\"( Phòng studio xung quanh trên mặt tiền Huỳnh Tấn Phát này giá đã từ 5tr5-6tr5 )\",\"Những điểm mạnh l tại chung cư là mặt tiền đường lớn thuận tiện đi lại, nhận giao hàng, không ngập nước, 2 hầm xe rộng rãi để gửi ô tô và xe máy, camera an ninh từng tầng, thang thoát hiểm phòng rác phòng điện phòng nước quản lỹ riêng biệt. Đặc biệt ít khách thuê phòng đa số là cư dân thuê nguyên căn hộ nên đi lại nhanh chóng, dân trí cao. Trong căn hộ có thông gió lấy sáng , gần bờ sông nên thoáng mát nhiều gió.\",\"- Không chung chủ, Giờ giấc tự do. Có tủ lạnh bảo quản thức ăn - nước uống và máy giặt dùng chung cho 1 căn hộ. Bảo vệ an ninh camera 24/24 ngoài hàng lang thang máy và trong căn hộ, mỗi tầng chỉ có 6 căn hộ, thiết kế căn hộ riêng biệt nên rất yên tĩnh.\",\"Wifi 5G mạnh vi vu. Có 2 tầng hầm gửi xe.\",\"Tiện ích ngay chung cư:\",\"- Có 8 tầng trung tâm thương mại cho thuê phía trước.\",\"- Kinh doanh Phòng Gym Power - Fisnet yoga, Sân chơi Gold 3D, Trung tâm anh ngữ ila, Văn phòng công ty\",\"- Ngay cạnh Phú Mỹ Hưng, Quận 7, Co. Op Mart, Crescent Mall, Cầu Phú Mỹ,...\",\"- Ngay mặt tiền đường Huỳnh Tấn Phát bán kính 100m xung quanh đầy đủ quắn ăn, cafe, gara, tạp hoá, siêu thị đầy đủ.\",\"Liên hệ hoặc nhắn zalo để thêm thông tin và hẹn xem phòng.\",\"Vui lòng đọc kỹ bài viết . Xin cảm ơn..!\"]', 'fbf67363-278c-4e9e-bd3c-f951f4e5a1ad', '21b7e16f-eded-40b0-938d-191bcaa229af', '9e3df3dc-5de6-40ae-843c-9e6219d1244f', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
