('68079084-ace0-4b50-9c99-7f8b67ece1bf', 'Chính Chủ Cho Thuê Văn Phòng Tầng 1 - 2, 20tr/tháng, Đường Nguyễn Lương Bằng Quận Đống Đa', '2', 'TBE5', 'Địa chỉ: 80/180 Nguyễn Lương Bằng, Phường Quang Trung, Quận Đống Đa, Hà Nội', '042f0a84-b8e7-481e-ae54-7a7fe71ddca9', 'MBVP', '[\"CHÍNH CHỦ CHO THUÊ VĂN PHÒNG TẦNG 1 - 2, GIÁ THƯƠNG LƯỢNG, ĐƯỜNG NGUYỄN LƯƠNG BẰNG QUẬN ĐỐNG ĐA\",\" Địa chỉ: 80/180 đường Nguyễn Lương Bằng, quận Đống Đa\",\" Vị trí Trung Tâm, giao thông thuận tiện, sầm uất, xung quanh đầy đủ tiện ích\",\"Nhà có 7 tầng, cho thuê tầng 1 và tầng 2, DT 80 x 2 = 160m2, thích hợp mở văn phòng hoặc kinh doanh online,...\",\" Không gian sạch sẽ, thoáng mát, nhà vệ sinh riêng\",\" Có sẵn điều hòa\",\" Hướng nhà kinh doanh tốt\",\"Giá thuê: 20 triệu/tháng\"]', '38ec745b-59b7-4ccf-a192-5cbc497ee1fe', '77b7a1cd-12f7-4a41-92e0-18db53f6a7d7', '23d7d037-68a3-46da-b5e4-05c82abc8647', '2024-03-23 19:22:29', '2024-03-23 19:22:29'),
('6a0b2ee8-572d-490a-ad54-aa78eba782e1', 'Cho thuê phòng trọ 86/35 Trường Chinh, full nội thất gần Ngã tư Bảy Hiền, sát chợ, ra sân bay chỉ tầm 5 phút', '4', 'QNF7', 'Địa chỉ: 86/35 Đường Trường Chinh, Phường 12, Quận Tân Bình, Hồ Chí Minh', 'dd38a1eb-b861-4af7-a692-92074702214c', 'CTPT', '[\"CHỈ CÒN 1 PHÒNG DUY NHẤT SIÊU ĐẸP\",\"Cho thuê phòng trọ đầy đủ nội thất ở 86/35 Trường Chinh, phường 12, Tân Bình\",\"Vị trí đắc địa gần ngã tư bảy Hiền, Ra sân bay 5 phút, gần bệnh viện Thống Nhất, đại học Hồng Bàng, Học viện Hàng Không, tiện di chuyển đến các quận trung tâm \",\"Đi cách một bước chân có chợ, tạp hóa, ngay Xuân Hồng Trường Chinh\",\"Phòng sạch sẽ, siêu đẹp, full nội thất hiện đại như: giường nệm, tủ quần áo...\",\"Phòng lớn 45m2, giá 6,5 triệu/tháng\",\"Ở được từ 5 đến 6 người\",\"Giờ giấc tự do\",\"Khoá vân tay đảm bảo an ninh\"]', 'b736c975-e494-4427-8861-05e81a09908c', '8513695b-54dd-4601-908d-8695cb7e7d31', '101cc122-3c4d-4f67-a228-db14ffbe20b5', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
('6a8cbc6f-ed61-4d4b-9093-61f45650a5f5', 'Cho thuê nhà nguyên căn, phù hợp sinh viên/NVVP', '0', 'LII2', 'Địa chỉ: 292/2 Bà Hạt, Phường 9, Quận 10, Hồ Chí Minh', 'df5aea60-828a-4b0c-9dd8-14f033d6e1de', 'NCT', '[\"Cho thuê nhà nguyên căn\",\"Nhà thoáng\",\"1toilet dưới trệt\",\"2 lầu đều có ban công\",\"Tổng diện tích sàn 39.2m2\",\"Nhà trống. Có ngăn cầu thang\",\"Phù hợp gia đình nhỏ hoặc sinh viên ở ghép\",\"Giờ giấc tự do, tự giữ chìa khóa\",\"Gần đại học Kinh tế, Huflit, chợ...\",\"Nhà để tối đa 3 chiếc xe. Ko tốn tiền gửi xe\",\"Nếu thuê, Cọc 1 tháng, HĐ 12 tháng\",\"Gọi trước 30p khi muốn qua xem nhà.\",\" \"]', '0d344b69-9060-4572-971d-8c8e62d82b8a', '911b4db7-51ae-4114-8812-8c0fbb909eba', '52440439-5210-4e4a-9e98-2cbae0531ae5', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
