('6e70219c-6d0c-4e7c-97e7-032fd8687120', 'Chính Chủ Cho Thuê Nhà Nguyên Căn 150m2 Giá Rẻ Gần Gigamall Thủ Đức', '2', 'TLY1', 'Địa chỉ: 62 Đường số 27, Phường Hiệp Bình Chánh, Thủ Đức, Hồ Chí Minh', '797491ec-1f10-49c7-8341-9b0ccd7721f7', 'NCT', '[\"Chính Chủ Cho Thuê Nhà Nguyên Căn 150m2 Giá Rẻ Gần Gigamall Thủ Đức Ngay 62 đường số 27, TP Thủ Đức\",\"Giá: 25 triệu/tháng (có thương lượng cho khách có thiện chí)\",\"Diện tích: 6x25 m\",\"Nhà bao gồm:1 trệt 1 lầu ( trần cao thoáng)\",\"Hẻm to ô tô thoải mái\",\"Ký hợp đồng bàn giao ngay\",\"Có dàn điện năng lượng mặt trời tránh trường hợp mất điện đột xuất\",\"Tặng gói dọn vệ sinh khu vực chung 3 ngày 1 tuần\",\"Có camera giám sát an ninh 24/24, cho nuôi thú cưng\",\"Khu dân cư văn minh, dân trí cao,  tiện đi lại, cách công viên Peace 5p đi bộ, cách Gigamall 10p chạy xe,...\",\"Phù hợp: Để ở, kinh doanh spa, Văn phòng đại diện, kinh doanh onl, dạy học,...v.v\",\"Hợp đồng lâu dài, nhận nhà ngay.\"]', '4525fd1b-ac6b-4015-be02-81f691c58ccf', '8c482630-b638-4c66-bb00-0aceca2f4557', '0a3860a3-bec6-4245-a301-ecdfa907af1c', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
