('7443c6ce-9e12-4a0e-b486-25de52159309', 'Nhà phố 84m2 hoàn thiện có máy lạnh và thang máy cho thuê trệt 25 triệu', '0', 'EUM7', 'Địa chỉ: Đường Nguyễn Xiển, Phường Long Bình, Quận 9, Hồ Chí Minh', '2a7f8e42-40b1-411b-82a5-34364a138714', 'MBVP', '[\"Loại hình: Nhà phố, nhà mặt tiền\",\"Giá thuê: 25 triệu đồng\",\"Diện tích: 84m2 ( 7x12 )\",\"Xây dựng: 1 trệt, 4 lầu, 1 áp mái.\",\"Tình trạng nội thất: hoàn thiện cơ bản, có máy lạnh có thang máy,\",\"Vị trí siêu đẹp gần trường học\",\"Địa chỉ: Dự án Vinhomes Grand Park - Quận 9 - TP Thủ Đức - TPHCM.\",\"Liên hệ: 0901002006 ( Hoàng Sinh)\",\" \",\"Minh Tín Land: D9-64 Manhattan vinhomes grand park quận 9\"]', 'bb7d1c62-8180-4686-8e58-9cdfbf44b3b6', '82e4485c-b6cf-4122-9063-a62cfdd15a28', 'a3cbb615-b2f8-4768-a66f-cf0c2499dcdf', '2024-03-23 19:22:29', '2024-03-23 19:22:29'),
