('78c25fb5-7565-474f-b163-87bab2cfe0a7', 'Cho thuê nhà nguyên căn tiện kinh doanh 603m2 ngay mặt tiền Quang Trung, Gò Vấp', '0', 'JSN8', 'Địa chỉ: Quang Trung, Phường 11, Quận Gò Vấp, Hồ Chí Minh', '2566a33e-fcd4-4922-acbd-ddce82ccd3d4', 'NCT', '[\"Cho thuê nhà nguyên căn tiện kinh doanh rộng 603m2 tại trung tâm thương mại Starmart\",\" Có nơi đậu xe máy và ôtô cho khách hàng\",\"Vị trí thuận tiện, gần chợ hạnh thông tây, Uỷ ban nhân dân Quận GV, bệnh viện, trường học \",\"Cơ sở vật chất được trang bị sẵn \",\"Hệ thống phòng cháy chữa cháy đảm báo\",\"Có thể cải tạo lại theo mô hình kinh doanh của mình\",\" Nhà có thiết kế  1 trệt 1 lầu \",\"Tầng trệt: 12m68 x 29m56 (375 m2)\",\"Lầu 1: 14m40 x1 5m85 (228 m2).\",\"Tiện kinh doanh: ăn uống, coffee, nhà hàng lẩu, đồ nướng, mô hình trường học anh ngữ.....\",\"Liên hệ: Phòng Kinh doanh TTTM STARMART\",\"0949988777 Mr Nam\"]', 'a2d9a8a6-dd9a-462a-ba62-bd526b0f5486', '98c35448-1193-4ec6-b042-b2e8795e73d9', '7663a57a-1f91-48bd-8228-8e2df2b6f8c3', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
('7ed0b83c-de27-464d-8241-4be0b83e4adc', 'Cho thuê phòng trọ dạng chung cư mini máy lạnh Q.8 gần Đại lộ Đông Tây, Q.5, Q.6', '5', 'VYE7', 'Địa chỉ: 154/21-154/23 Đường Hoàng Ngân P.16, Quận 8', '3f184966-66c1-4c4e-aee7-179b5144090e', 'CTPT', '[\"Cho thuê phòng trọ dạng chung cư mini P.16, Q.8, gần đại lộ Đông Tây, q5, q6. Phòng thoáng mát, yên tĩnh, có bếp, nhà vệ sinh riêng, cáp quang, wifi miễn phí, có gác đúc, đặt biệt có máy lạnh.\",\"Có camera quan sát tất cả các tầng và nhà xe.\",\"Diện tích sử dụng từ 18-22 m2.Giá từ 1.800.000 đến 2.100.000 đồng.\",\"Địa chỉ: 154/21-154/23 Hoàng Ngân (Đường 41, Phú Định cũ), P.16, Q.8, gần giao lộ Võ Văn Kiệt (đại lộ Đông Tây) và đường An Dương Vương.\",\"LH : Chị Hồng 0379747974\",\"hoặc 0986.726.726\"]', 'f26583aa-2e7b-4ae1-a371-6f1a5e90de13', '39449a36-53cc-4219-8050-98e04c68743c', 'c81d2508-e2ed-4813-b1e7-aba42205c880', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
