('82de7217-a9ba-42c8-bbce-8f76c2fe7f0f', 'Chính Chủ Cho Thuê Phòng Trọ- Đường Ung Văn Khiêm, Quận Bình Thạnh', '3', 'QGT2', 'Địa chỉ: 97/15 Ung Văn Khiêm, Phường 25, Quận Bình Thạnh, Hồ Chí Minh', '0581cd96-61fc-4b2b-b2e5-b6bddc391357', 'CTPT', '[\"CHÍNH CHỦ CHO THUÊ PHÒNG - ĐƯỜNG UNG VĂN KHIÊM, Q. BÌNH THẠNH\",\"- Địa chỉ: 97/15, Ung Văn Khiêm, Phường 25, Quận Bình Thạnh.\",\"- Nhà trệt và chung cư. Vị trí rất thuận tiện: Ngay sau mặt tiền đường Ung Văn Khiêm, hẻm xe hơi, có camera an ninh, không ngập. Gần chợ, gần trường đại học Hutech, trường giao thông vận tải và trường tài chính Marketing, Vinmart, Coop Food, FamilyMart, giao thông thuận tiện gần Cầu Sài gòn nối Tp. Thủ Đức.\",\"- Thiết kế: Tổng diện tích sử dụng 20 - 25m2. Phòng khép kín (có kệ bếp, bồn rửa, toilet rộng rãi), máy lạnh, tủ lạnh, máy nước nóng, có cửa sổ lớn lấy gió và ánh sáng. Nhà sạch sẽ, thoáng mát.\",\"- Đồng hồ điện nước riêng, Wi-fi và Gửi xe miễn phí có bảo vệ quản lý, sử dụng vân tay ra vào khu nhà trọ. Có đường dây chờ sẵn (đường dây máy lạnh, nước nóng).\",\"- Giờ giấc: 6h00 mở cửa – 24h đóng cửa (phải về phòng trước 23h50). Phù hợp với hộ gia đình, nhân viên văn phòng, sinh viên.\",\"- Giá thuê phòng dao động: 3.000.000 đến 6.000.000 đ/tháng (tùy thuộc vào trang thiết bị bên trong phòng trọ (máy lạnh, tủ lạnh, máy nước nóng, bếp nấu ăn…). Tiền điện nước theo giá trên hóa đơn Công ty.\",\"- Vào ở ngay.\",\"- Chỉ nhận người thuê ở từ 01 năm trở lên. Ưu tiên Sinh viên, Hộ gia đình thuê ở ổn định lâu dài.\",\"* Liên hệ trực tiếp: Thành: 0988677308 hoặc Chị Ánh 0906483679 hoặc Chị Ly 0937173463\"]', '39a45471-4cb3-45b6-9af2-61f5cfdcaa37', '8037258e-f545-4f33-a2b1-be9b950a510e', '3da16783-5b54-4b2a-8288-66dd1c4f3c90', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
