('84e946c6-3d4c-4654-b3b4-d908fad730f6', 'Cho thuê phòng trọ mới sửa 7/2023 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú (gần Đầm Sen)', '5', 'RRK5', 'Địa chỉ: 48/13 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú, Hồ Chí Minh', '6114182a-172c-4618-9f64-c1dd09560f1b', 'CTPT', '[\"Giá Phòng từ 1800k. Đang còn phòng 1800K đến xem đảm bảo ưng ý, cam kết hình đúng với thực tế.\",\"Phòng mới sửa chữa 7/2023, địa chỉ 48/13 Lương Thế Vinh Phường Tân Thế Hòa, Q.Tân Phú, nhà hẽm xe hơi lộ giới 5m, lắp đặt hệ thống phòng cháy chữa cháy 9/2023\",\"Diện Tích 12m + 8m ( gác lững )\",\"Phòng có tolet riêng, cửa sổ, ban công, có phòng dưới trệt\",\"Cho nấu ăn trong phòng, Ở được 2-4 người, bạn bè lại chơi thoãi mái.\",\"Miễn phí internet, wifi, truyền hình cáp, Camera 15 cái ( an ninh quan sát không góc chết )\",\"Phòng Cháy Chữa Cháy lắp đặt từng phòng, lối đi, nơi để xe, xung quanh nhà đầy đủ\",\"Để xe trong sân nhà thoáng mát có người trông coi xe cộ.\",\"Vị trí gần Đầm Sen, thuận tiện qua lại Q.6, Q.11, Tân Phú\",\"Điện 3,5k/ 1 ký, nước 100k / 1 người, xe 100k/ 1 chiếc .\",\"Xe để sân sau nhà có người quản lý và trông coi ( không chung chủ ) giúp bạn có cảm giác an toàn, thoải mái\",\"LH : 0938864405 (Cường Phạm )\",\"LH zalo : 0938864405 ( Cường Phạm )\"]', '8edea1fe-ab97-4d13-b399-21ad032bb4c4', '7f91c892-4925-4b44-ad05-31e82ec97edf', 'ccb03582-7333-4383-a6ef-8c111ccc37b3', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
