('91e78828-21b8-4807-a480-0555baf7558c', 'CĂN HỘ DỊCH VỤ, CHUNG CƯ MINI VNAHOMES 350 ĐƯỜNG BƯỞI MẶT ĐƯỜNG CỬA SỔ LỚN', '2', 'GGA8', 'Địa chỉ: 350 Đường Bưởi, Phường Vĩnh Phúc, Quận Ba Đình, Hà Nội', '6bcee77a-1673-49f3-ad59-22f9e286f291', 'CTCH', '[\"Căn hộ dịch vụ, chung cư mini \\bcao cấp VNAHOMES 350 Đường Bưởi trung tâm quận Ba Đình:\",\"Vị trí trung tâm giữa các phố Đội Cấn, Quan Hoa, Hoàng Quốc Việt, Hoàng Hoa Thám.\",\"Cách chợ Bưởi 200m, Viện Phổi, 354 300m, Cung Thể Thao Quần Ngựa 500m, Lotte72 1km.\",\"Mặt đường lớn, ô tô đỗ cửa, thang máy, camera an ninh, phòng khép kín, giờ giấc tự do.\",\"Để xe tầng 1, thẻ từ, khóa vân tay, dọn vệ sinh đều đặn hàng tuần, dịch vụ bảo dưỡng định kỳ.\",\"Trang bị đầy đủ nội thất: TV smart, máy giặt riêng, chỉ xách vali đến ở\",\"Giá thuê: 4.500.000 - 5.200.000đ / tháng (đóng tiền linh hoạt từng tháng hợp đồng từ 6 tháng).\",\"Ngoài ra Libré Homestay by VnaHomes còn cho thuê căn hộ lưu trú ngắn hạn theo ngày, giờ tại các vị trí view đẹp, đắc địa của Hà Nội trong các tòa nhà do VnaHomes quản lý vận hành, hướng đến khách du lịch, nghỉ cuối tuần, khách công tác... Đặc biệt VnaHomes có dịch vụ xuất hóa đơn VAT cho khách hàng trong và ngoài nước.\",\"VNAHOMES - Hệ Thống Quản Lý Vận Hành Cho Thuê Khách Sạn Căn Hộ.\",\"Libré Homestay - Phong Cách Hiện Đại, Điểm Đến Tự Do.\"]', '89154c68-f3e9-48a3-89b9-b5b85fbf055b', '528314ca-55ae-4262-9c3f-110638455f77', 'cb8a130e-7d44-4227-8495-651522a3d03b', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
