('bf565deb-8f4f-4a8d-9369-0a5fcaace563', 'Nhà thuê nguyên căn đường lớn, trị an tốt, hàng xóm hòa đồng', '0', 'KML2', 'Địa chỉ: 842/21 Đường Nguyễn Kiệm, Phường 3, Quận Gò Vấp, Hồ Chí Minh', 'd46c0ba3-e366-4f9a-8ad6-8e87924d8f87', 'NCT', '[\"Cho thuê nhà nguyên căn, không cho thuê lẻ từng phòng, ưu tiên cho hộ gia đình, kinh doanh văn phòng hoặc kho bãi.\",\"Diện tích: nhà có 4 phòng ngủ, 2 phòng khách, 3 phòng vệ sinh và 1 gác xếp.\",\"Vị trí: nhà nằm trên đường hẻm rộng 6m, xe ô tô lớn có thể ra vào bình thường. Cách đường Nguyễn Kiệm 50m và thông qua Phạm Ngũ Lão.\",\"Tiện ích xung quanh: nhà gần nhiều trường đại học, chợ và giáp bệnh viện 175.\",\"Môi trường sống: khu dân cư lâu năm, yên tĩnh và trị an tốt. Nhà có một mặt tiếp giáp với dân cư và một mặt giáp tường bệnh viện.\",\"Chi phí sử dụng: giá điện, nước và rác được tính theo giá của nhà nước.\",\"Tiện nghi: nhà đã có truyền hình cáp SCTV và internet Viettel sẵn sàng sử dụng.\",\"Thời gian thuê tối thiểu: 1 năm (trả trước một khoản tiền cọc). Khi muốn dời đi sau một năm, người thuê cần thông báo trước một tháng. Khoản tiền cọc tương đương với một tháng tiền nhà.\"]', 'f1da69e9-bd6d-4584-9ece-3c21a65f7203', 'b86656b1-02b5-4c24-9ead-5a2ec063696e', '51f415ad-aa19-4fc1-8eef-7846b94aa4a8', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
