('e2fa8525-3938-4681-81d0-82e109e1486a', 'Phòng Master Tolet riêng Căn hộ Chung cư Era Town Đức Khải, Phường Phú Mỹ, Quận 7', '5', 'YJL6', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '201b0938-fa53-4629-9539-b4ce881573c2', 'CTPT', '[\"Chính chủ cho thuê phòng trọ trong căn hộ Chung cư Era Town Đức Khải.\",\"Khu chung cư rộng rãi, thoáng mát , an ninh, tiện ích đầy đủ , tổng diện tích hơn 10ha với hơn 3000 căn hộ, cư dân đông đúc, đường xá rộng rãi, thông thoáng kết nối giao thông thuận tiện với các quận, trường học -chợ đi bộ ngay dưới chung cư. Cây xanh và bờ sông bao quanh khu này cực mát nhé mọi người.\",\"- Phòng master 15m2 toilet riêng có ít nội thất giá 3tr\",\"- Phòng master 18m2 trống giá 3tr2\",\"- Phòng master 18m2 có máy lạnh bàn giá 3tr4\",\"- Phòng master 27m2 toilet riêng góc 2 view cửa sổ lớn view sông có nội thất máy lạnh, máy nước nóng giá 3tr8\",\"- Phòng Tolet chung 1 người ở giá 1tr6-2tr diện tích 7-10m2 có cửa sổ.\",\"Tất cả các phòng đều có tủ lạnh máy giặt bên ngoài sử dụng .Khu bếp và ban công giặt phơi rộng rãi.\",\"Quan tâm LH sđt hoặc nhắn zalo nếu cần thêm thông tin. Vui lòng đọc kỹ bài đăng của mình.\",\"Chủ nhà thân thiện, hoà đồng, tâm lý.\",\"Xin cảm ơn..!\"]', '4e7d6383-e4f7-4bd7-8e9d-0ba3f7093028', 'a3bb1701-fefa-4614-b1dd-d75595fea70f', 'e4b43286-425e-430d-af42-dff7accc5f01', '2024-03-23 19:28:42', '2024-03-23 19:28:42'),
('e5182a3c-7a4b-4b67-a664-45c117c85bdd', 'Phòng Ban công FULL Nội Thất cao cấp Ngay Sân bay TSN, Rộng rãi, An ninh, GIá rẻ. ánh sánh tự nhiên', '2', 'MVT2', 'Địa chỉ: 2/26 Đường Bạch Đằng, Phường 2, Quận Tân Bình, Hồ Chí Minh', 'e4954c9d-7d14-468e-a9e3-dc749dd8101d', 'CTCH', '[\"Phòng cao cấp full nội thất, sang trọng phù hợp với người đi làm, cặp vợ chồng son.\",\"Phòng có ban Công, cửa sổ thoáng mát, ánh sáng tự nhiên\",\"Ngay Gần Sân Bay Tân Sơn Nhất, Công viên Gia định,…\",\"Liên hệ NGAY để xem phòng: 0931610338\",\"Nội thất: - Một giường lớn, 1 tủ đồ, 1 tủ lạnh, máy lạnh, tivi, 1 bộ bàn ghế, bếp,...\",\"Phòng thật như hình\",\"Tiện nghi hàng đầu:\",\"+ Cửa bảo mật vân tay và mật khẩu An ninh\",\"+ Wifi internet đầy đủ\",\"+ Free xe\",\"+ Có nhà vệ sinh riêng,...\",\"+ Giờ tự do,\",\"+ Phòng trên lầu nên đi thang bộ, phù hợp với người muốn nâng cao sức khỏe, thích rèn luyện thể lực\",\"+ Không phù hợp với người không thích đi thang bộ\",\"Giá thuê: 4Tr6\",\"Địa chỉ: 2/26 Bạch đằng, quận Tân Bình, Tp.HCM – Ngay Gần Sân Bay Tân Sơn Nhất, Công viên Gia định,…\",\"Liên hệ NGAY để xem phòng: 0931610338\"]', 'ac74f4dd-37a3-4f61-9beb-51f3809b8394', 'f763742a-5608-496a-865b-bd9de4457898', '60ad6433-d9bd-4709-872a-1fbe5a3a78e5', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
