('f1c97364-5da2-4520-9b30-006a136a7b22', 'Cho thuê Phòng 1K1N tại CCMN tại Số 9/23, ngõ 408 Trần Cung', '2', 'KJV8', 'Địa chỉ: Nhà số 9/23 ngõ 408 Trần Cung, Phường Cổ Nhuế 1, Quận Bắc Từ Liêm, Hà Nội', '8bfeece1-d778-4818-93d8-b3b157f6ea4f', 'CTCH', '[\"Cho thuê Phòng 1K1N tại CCMN tại Số 9/23, ngõ 408 Trần Cung (tháng 4 vào ở).\",\"gần Bệnh viện E\",\"Nội thất gồm: Điều hoà, nóng lạnh, tủ bếp trên dưới, sofa, rèm cửa, máy giặt chung, giường tủ, bếp từ, bàn bếp, sân phơi đồ rộng rãi.\",\"Hệ thống phòng cháy chữa cháy tự động, có thang máy.\",\"Camera an ninh.\",\"Giá dịch vụ: Điện 3,8k/số; nước 28k/khối; dịch vụ 150k/người; Intenet 100k/phòng.\",\"Giá phòng: 6,3tr đồng/tháng.\",\"️ Ibox/Zalo: 0974.253.666 để xem phòng và hưởng giá ưu đãi.\"]', '1aa9564d-b5c9-43c7-8b93-c38f17671acc', 'e85b7f68-eec2-4766-8894-a07346c3a066', '47789ad0-ae66-4db5-a637-2d0453e13f3e', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
('f224ace1-1c63-4ab7-815b-014656a47265', 'Căn hộ mới xây đầy đủ nội thất ngay mặt tiền Xa Lộ Hà Nội, ngã 4 Thủ Đức, view cực đỉnh', '0', 'YNG9', 'Địa chỉ: 546 Xa Lộ Hà Nội, Phường Phước Long A, Quận 9, Hồ Chí Minh', 'a14a65d5-d9ed-4fb2-995c-89d83740ddca', 'CTCH', '[\"KHAI TRƯƠNG KHU CĂN HỘ MỚI XÂY NGAY MẶT TIỀN ĐƯỜNG XA LỘ HÀ NỘI ️\",\"CĂN HỘ FULL NỘI THẤT CAO CẤP, TIỆN NGHI, RỘNG ĐẸP\",\"Địa chỉ: 546 Xa lộ Hà Nội, P.Phước Long A, Quận 9 (cũ)\",\"Đa dạng phòng từ 18 - 30m2\",\"Đầy đủ nội thất cao cấp: kệ bếp, tủ quần áo, bàn làm việc, sofa, giường nệm, điều hoà, nóng lạnh NLMT,....\",\"Cửa sổ, ban công thoáng mát, rộng rãi, view cực đỉnh\",\"⌚Giờ giấc tự do, thoải mái\",\"Thang máy hiện đại\",\"Hầm xe rộng rãi\",\"Cổng vân tay 2 lớp, an ninh\",\"Trước nhà có tuyến QL52 cực thuận tiện\",\"‍️ Vị trí đẹp, thuận lợi, dễ dàng di chuyển\",\"Liên hệ: 0877.4444.95 Mr.Hùng để được trải nghiệm căn hộ tận mắt\"]', '7b247995-dde3-40cc-a663-b733e9f6d1a9', '5c537afa-a429-453d-a593-b209a42296d9', '07554a7c-2eb9-414e-88f0-dcc7ced4c675', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
('f26531ec-b85c-4659-9718-4f5671fd78f4', 'Cho thuê căn hộ hướng Đông Nam Khu Tập Thể Vĩnh Hồ. Liên hệ: Anh Bính 0358006014', '0', 'DIH4', 'Địa chỉ: Quận Đống Đa, Hà Nội', '57f13a92-2907-4e16-9b96-35b18e727856', 'CTCH', '[\"Cho thuê căn hộ tập thể chính chủ tại khu C5 Tập thể Vĩnh Hồ,Phố Thái Thịnh\",\"Diện tích : 30m -35m2.\",\"Địa điểm : gần chợ Vĩnh Hồ, bệnh viện Châm Cứu TW,trường mầm non Hoa Hồng,Mipec và Hà Thành Plaza\",\"Điện, nước: theo hóa đơn giá nhà nước\",\"Giá: 03 triệu/tháng\",\"Miễn trung gian.\",\"Liên hệ Anh Bính 0358006014\"]', 'a3c18a68-938a-40bf-82fb-4ed717fe6b61', '00371f4f-b966-4a09-96e8-bb1097d1d7c3', 'd0a58b51-4b1a-45fe-86ae-0a1b869b8233', '2024-03-23 19:20:49', '2024-03-23 19:20:49'),
('f61f326d-b020-409c-81c6-78de2851324d', 'Cho thuê nhà ngay Vườn Lài quận Tân Phú 40m2 -1 lầu chỉ 8 triệu TL', '0', 'BGC3', 'Địa chỉ: Đường Vườn Lài, Tân Thành', '210e228f-2d56-489a-a866-7f421ad1904d', 'NCT', '[\"Nhà cho thuê hẻm 3m, cách mặt tiền đường Vườn Lài 10m, quận Tân Phú \",\"DT: 4 x 10m = 40m2, 1 trệt 1 lầu\",\"Thiết kế 2PN, 2WC\",\"Nhà có ban công và giếng trời rất thoáng mát, thích hợp ở kết hợp kinh doanh\",\"Giá thuê: 8tr/tháng, ngày 5/4 nhận nhà được \",\"LH: 0765.301.820\"]', '48974860-f398-416c-9cfd-accceb3e74b2', '84dbfb9e-8cb4-490d-9f36-737c05fe2e7e', '2ed608b4-23cd-44d3-b77e-a458123d1e9c', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
('f818eec7-1af2-465b-8aba-ae1a35a9826e', 'Cho thuê nhà ở nguyên căn tại 124 Lạc Long Quân, TP Phúc Yên', '0', 'ZVC7', 'Địa chỉ: 124 Đường Lạc Long Quân, Phường Hùng Vương, Thành phố Phúc Yên, Vĩnh Phúc', '6c49e172-27fe-435a-a5af-46879555c72e', 'NCT', '[\"️️️Chính chủ cho thuê nhà mặt phố  124 Lạc Long Quân, Hùng Vương , TP.Phúc Yên\",\"Vị trí giao thông thuận tiện, gần trường học, bưu điện và trung tâm thành phố Phúc Yên.\",\"Nằm ở khu phố rộng rãi to đẹp sầm uất \",\"Diện tích 70m2\",\"Thích hợp để kinh doanh, làm văn phòng hay nhà ở đều rất đẹp nhé. Giá cả hợp lý. Bác nào muốn thuê lâu dài ib cho mình hoặc gọi cho mình nhé\",\"️ Vui lòng liên hệ 0349473422\",\" \"]', 'c2b9b98b-201b-4055-ac23-b037132abfb9', '91ae0ffb-21f8-4f7f-9f12-4e23f240f90e', 'a72cb310-556d-4cec-87b0-1dbc613f1ff7', '2024-03-23 19:27:13', '2024-03-23 19:27:13'),
('fabf50a4-5537-409c-8a2a-613e5d1fb099', 'CHÍNH CHỦ CHO THUÊ NHÀ NGUYÊN CĂN NGAY TT QUẬN 1, 24M2, 2PN, THÍCH HỢP Ở VÀ KINH DOANH', '2', 'FIX3', 'Địa chỉ: 214b/c32 Đường Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, Hồ Chí Minh', '2ba88cc8-29e3-4afa-a287-accd89ed7b08', 'NCT', '[\"CHÍNH CHỦ CHO THUÊ NHÀ NGUYÊN CĂN NGAY TT QUẬN 1, 24M2, 2PN, THÍCH HỢP Ở VÀ KINH DOANH\",\"Địa chỉ: 214b/c32 đường Nguyễn Trãi, phường Nguyễn Cư Trinh, quận 1\",\"DTSD: 1.6 x 15 = 24m2\",\"1 trệt 1 lầu, 2PN, 1WC, thoáng mát, sạch sẽ\",\"Phía dưới suốt, có thể vừa ở vừa kinh doanh, mua bán nhỏ. Vị trí ngay trung tâm quận 1 nên rất thuận tiện cho việc buôn bán.\",\"Giá thuê: 7tr5/tháng\",\"Liên hệ: 0918797950 gặp chị My\"]', 'c202dfac-eee4-4342-b8cb-ab9fb9f94a87', '52ef26bf-1eae-4fb8-83e0-60f07b25de30', 'b84c9062-d788-4ed4-9426-f96a0feb2892', '2024-03-23 19:27:13', '2024-03-23 19:27:13');
